import styled from 'styled-components';
import { Grid } from '@material-ui/core';


export const FooterBar = styled(Grid)`
  background: red;
  position: fixed;
  left: 0;
  bottom: 0;
  width: 100%;
  background-color: red;
  color: white;
  text-align: center;
`;

export default { FooterBar };
